import React,{Component} from 'react';  

// import OwlCarousel from 'react-owl-carousel';  






export class Owldemo1 extends Component {  

        render()  

        {  

          return (  
            <div>  
<section className="w3l-stats py-lg-5 py-5" id="stats">
          <div class='container-fluid gallery-inner container py-md-5 py-3' >      
          <div className="row stats-con">
        

                   

        {/* <OwlCarousel items={4}  

          className="owl-theme"  

          loop  

          nav  

          margin={8} >   */}

<div><img className="img " src= {'https://mobatia.com/wp-content/uploads/2020/01/nas-1.png'}/></div>  


<div ><img  className="img  " src= 'https://mobatia.com/wp-content/uploads/2020/01/vkc-1.png'/></div>  

<div><img  className="img  " src= 'https://mobatia.com/wp-content/uploads/2020/01/ch.png'/></div>  

<div><img  className="img" src= {'https://mobatia.com/wp-content/uploads/2020/01/wiss.png'}/></div>        

<div><img  className="img" src= {'https://mobatia.com/wp-content/uploads/2020/01/sgh.png'}/></div>  

<div><img className="img" src= {'https://mobatia.com/wp-content/uploads/2020/01/beverly.png'}/></div>  

<div><img className="img" src= {'https://mobatia.com/wp-content/uploads/2020/01/ca.png'}/></div>  


      {/* </OwlCarousel>   */}

      </div>  
</div>

  
      </section>
      </div> 
     
          )  

        }  

      }  


  

export default Owldemo1  ;
